import React from "react";
import  "./AdviseCard.css";


function AdviseCard(){

    return(
        <div className="container">
            <div className="adviceCard">
                <h6 className="advisehead">ADVICE <span>#1</span></h6>

                <p className="adviceBody">
                    "If you cannot provide a valid href, but still need the element to resemble a link, 
                        use a button and change it with appropriate styles." 
                </p>
                
                <svg width="444" height="16" xmlns="http://www.w3.org/2000/svg"><g fill="none" fill-rule="evenodd"><path fill="#4F5D74" d="M0 8h122v1H0zM173 8h122v1H173z"/><g transform="translate(138)" fill="#CEE3E9"><rect width="6" height="16" rx="3"/><rect x="14" width="6" height="16" rx="3"/></g></g></svg>

            </div>
        </div>
    )
}


export default AdviseCard;
